import './style.css';
import { Link } from 'react-router-dom';
import imgBrasilia from './components/i'


const Promocoes = () => {
    return (
        <article>
            <p className='container page_body'>
            <h1>Promoções</h1>
                       
            <Link  to="/cadastrar"className='btn btn-light'>Cadastrar Cupom &raquo;</Link><br/>
            
            <img src="imgBrasilia.jpg"/>
            
            </p>

                       

                    
        
        </article>
    );
}

export default Promocoes;
